// utils.js (client)
import "isomorphic-fetch"
import startTime from "../pages/index.js";
import endTime from "../pages/index.js";

export function addName(name) {
  const difference = endTime - startTime;
    return fetch('http://localhost:3001/addtime', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ name, time: difference }) // the reason you're getting wacky number is because its counting time down from 1970
    })
}
